// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";

contract NFTLending {
    struct Loan {
        address lender;
        address borrower;
        uint256 nftId;
        uint256 amount;
        uint256 interest;
        uint256 duration;
        bool isActive;
    }

    IERC721 public nftContract;
    mapping(uint256 => Loan) public loans;

    event LoanCreated(uint256 indexed nftId, address indexed lender, uint256 amount, uint256 interest, uint256 duration);
    event LoanRepaid(uint256 indexed nftId, address indexed borrower);
    event LoanDefaulted(uint256 indexed nftId);

    constructor(address _nftContract) {
        nftContract = IERC721(_nftContract);
    }

    function createLoan(uint256 _nftId, uint256 _amount, uint256 _interest, uint256 _duration) external {
        require(nftContract.ownerOf(_nftId) == msg.sender, "Not the owner");
        nftContract.transferFrom(msg.sender, address(this), _nftId);

        loans[_nftId] = Loan({
            lender: msg.sender,
            borrower: address(0),
            nftId: _nftId,
            amount: _amount,
            interest: _interest,
            duration: _duration,
            isActive: true
        });

        emit LoanCreated(_nftId, msg.sender, _amount, _interest, _duration);
    }

    function borrow(uint256 _nftId) external payable {
        Loan storage loan = loans[_nftId];
        require(loan.isActive, "Loan not active");
        require(msg.value == loan.amount, "Incorrect amount");

        loan.borrower = msg.sender;
        payable(loan.lender).transfer(msg.value);

        // Additional logic for interest and duration can be added here
    }

    function repayLoan(uint256 _nftId) external payable {
        Loan storage loan = loans[_nftId];
        require(loan.borrower == msg.sender, "Not the borrower");
        require(msg.value == loan.amount + loan.interest, "Incorrect repayment amount");

        nftContract.transferFrom(address(this), loan.borrower, _nftId);
        loan.isActive = false;

        emit LoanRepaid(_nftId, msg.sender);
    }
}
